First, let's combine like terms in every parentheses:
- (-53*x+18*x) simplifies to -35*x;
- (+32*x-22*x) simplifies to 10*x;
- (+62*x+50*x) simplifies to 112*x;
- (+18*x-2*x) simplifies to 16*x.

This gives us:

((-35*x +10*x) + (112*x +16*x)).

Next, we continue to combine like terms:

- -35*x + 10*x simplifies to -25*x;
- 112*x + 16*x simplifies to 128*x;

Our expression then becomes: 

((-25*x) + 128*x). 

This finally simplifies to 103*x. 

However, because the question asks for each numerical coefficient modulo 100, the final result will be 3*x.
